const initialState = {
    modal: false,
};
   
export default (state = initialState, action) => {
    switch (action.type) {
      case 'MODAL_TRUE':
        return {
          ...state,
          modal: true,
        };      
      case 'MODAL_FALSE':
        return {
          ...state,
          modal: false,
        };                
      default:
        return state;
    }
};
